import React from 'react';
import Home from './Home'
import Map from './Map';
import './App.css';
import {Routes, Route} from "react-router-dom";




export default function App() {
  return (
      <div className = "App">
        <Routes>
            <Route path = "/" component ={<Home/>}/>
            <Route exact path = "/Map" component = {<Map/>}/>
        </Routes>
      </div>
  );
}
